import React, { Component } from 'react';
import { Tabs, Tab } from '@blueprintjs/core';

export default class Targets extends Component {
   state = {
      activeTabID: 1
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });
   render() {
      return (
         <Tabs onchange={this.handleTabChange} large>
            <Tab id='1' title='KPIs' panel={<div>KPIs</div>} />
            <Tab id='2' title='Reports' panel={<div>KPIs Reports</div>} />
         </Tabs>
      );
   }
}
